import logo from './logo.svg';
import './App.css';
import Flights from './views/Flights.jsx';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <main>
      <Routes>
        <Route index element={<Flights/>}/>
      </Routes>
    </main>
    </BrowserRouter>
  );
}

export default App;
